0.dialog:
{
    "0": {
        "ACTION": "BUYER",
        "CONTENT": "你醒啦",
        "NEXT": "1"
    },
    "1": {
        "ACTION": "ME",
        "CONTENT": "你是谁，我在哪",
        "NEXT": "2"
    },
    "2" : {
        "ACTION": "BUYER",
        "CONTENT": "我是这个世界的神，你为了救一个原本就不会死的小男孩而死",
        "NEXT": "3"
    },
    "3" : {
        "ACTION": "BUYER",
        "CONTENT": "你看过地狱笑话的时候笑过，原本应该下地狱",
        "NEXT": "4"
    },
    "4" : {
        "ACTION": "BUYER",
        "CONTENT": "但你为了善良的理由死去，所以我决定给予你一次成为成为天使的机会",
        "NEXT": "5"
    },
    "5" : {
        "ACTION": "BUYER",
        "CONTENT": "鉴于你之前的行为，我还要再给你最后一次考验",
        "NEXT": "6"
    },
    "6" : {
        "ACTION": "BUYER",
        "CONTENT": "我在人流密集的街区放置了一个特殊的彩票投注站，你来经营这个彩票站",
        "NEXT": "7"
    },
    "7" : {
        "ACTION": "BUYER",
        "CONTENT": "与普通的彩票站不同是，卖出去的彩票是否中奖由你决定，当然买的人会以为彩票是随机的",
        "NEXT": "8"
    },
    "8" : {
        "ACTION": "BUYER",
        "CONTENT": "你只能决定是否中奖，中的是几等奖，则由我————上帝投骰子决定",
        "NEXT": "9"
    },
    "9": {
        "ACTION": "OPTION",
        "CONTENT": "如果你能坚持5天，就可以通过考验。怎么样，要接受这个考验吗",
        "OPTION": [
            "10", "11"
        ]
    },
    "10": {
        "ACTION": "BUYER",
        "CONTENT": "好，每天结束的时候我会检查投注站账上的余额，如果是负数，考验就失败了",
        "NEXT": "12"
    },
    "11": {
        "ACTION": "REFUSETOPLAY",
        "CONTENT": "好吧，这也不令人意外",
        "NEXT": "13"
    },
    "12": {
        "ACTION": "BUYER",
        "CONTENT": "我会经常来看你的，祈祷我会投出令你幸运的骰子吧",
        "NEXT": "LEAVE"
    },
    "13": {
        "ACTION": "BUYER",
        "CONTENT": "你是认真的吗，我真的花了很久准备这个考验",
        "NEXT": "14"
    },
    "14": {
        "ACTION": "BUYER",
        "CONTENT": "算了，我尊重你的选择，再见",
        "NEXT": "QUIT"
    }
}

